INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300101, 10, 8, 4, 7, 1, 10, 1, 1, 3001, 3.18, "vo_minigame_1012_result_1000", "フフ、全問正解よ！\nちゃんと勉強してるみたいで\n感心だわ♪");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300102, 10, 7, 10, 8, 1, 10, 1, 1, 3001, 3.33, "vo_minigame_1012_result_1001", "すごいじゃない…全問正解よ！\nま、当然といや当然よね～\nだってあたしが\n教えてやってんだから♪");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300103, 10, 1, 10, 8, 1, 10, 1, 1, 3001, 5.41, "vo_minigame_1012_result_1002", "全問正解！　パチパチパチ～♪\nこの難易度はもう完璧じゃない？\n次はもっと難しい問題に挑戦よ！\nあんたならできるって！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300104, 10, 8, 10, 5, 2, 10, 1, 1, 3001, 8.11, "vo_minigame_1012_result_1003", "へえ…難しい問題を選んだのに\n全問正解できてるじゃない！！\nちょっとあんたすごすぎだわ…！\nパーフェクトよパーフェクト！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300105, 10, 5, 0, 10, 2, 10, 1, 1, 3001, 1.31, "vo_minigame_1012_result_1004", "まる…まる…全部まる！\n難しい問題なのに全問正解よ…！\n驚いた…あんたいつの間に、\nこんなに勉強してたのよ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300106, 10, 8, 0, 9, 2, 10, 1, 1, 3001, 4.93, "vo_minigame_1012_result_1005", "ここまで完璧に正解されちゃうと\nちょっと悔しいわね…！\nけど素直に褒めてやるわ！\nえらい、えらい、えら～い！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300107, 10, 8, 4, 5, 3, 10, 1, 1, 3001, 2.99, "vo_minigame_1012_result_1006", "すごい…あんたパーフェクトよ！\nこのままいけば次の試験、\n学年一位も夢じゃないかもね！\n楽しみだわ～♪");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300108, 10, 7, 4, 8, 3, 10, 1, 1, 3001, 8.37, "vo_minigame_1012_result_1007", "満点よ！　フフ、もうあんたに\n教えることはなにもないわ…！\n逆にあたしがあんたに教わりたい\nくらいよ！　…ね、先生♪");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300109, 10, 5, 8, 7, 3, 10, 1, 1, 3001, 5.32, "vo_minigame_1012_result_1008", "全・問・正・解！\n超難問揃いなのにすごいわね…！\nもしかしてだけど、\nあんたって天才！？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300110, 7, 1, 4, 7, 1, 9, 1, 1, 3001, 4.77, "vo_minigame_1012_result_1009", "お、かなりいい点数ね～！\nあたしも教えがいがあるわ♪\nさ、まだまだ勉強するわよ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300111, 7, 7, 4, 8, 1, 9, 1, 1, 3001, 2.97, "vo_minigame_1012_result_1010", "うん、いい感じで点取れてるわ！\nこの調子で次は、\n満点を見せてほしいわね！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300112, 7, 1, 0, 5, 1, 9, 1, 1, 3001, 3.47, "vo_minigame_1012_result_1011", "あ～惜しい！\nもうちょっとで満点じゃない！\n次はパーフェクトいけるわ！\n頑張りましょ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300113, 7, 7, 4, 8, 2, 9, 1, 1, 3001, 5.32, "vo_minigame_1012_result_1012", "すごい、かなりできてるわよ！\n難しい問題なのにやるじゃない！\nあとは目指せ、満点ね！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300114, 7, 7, 10, 8, 2, 9, 1, 1, 3001, 6.49, "vo_minigame_1012_result_1013", "うん、かなりいい感じよ！\nあんたには赤点の心配なんて\nまーったくなさそうね♪\nでも勉強はやめさせないけど！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300115, 7, 1, 0, 5, 2, 9, 1, 1, 3001, 3.56, "vo_minigame_1012_result_1014", "あーあとちょっとで\n全問正解だったのに！\n難しい問題だけどあんたなら\n次は満点狙えるわ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300116, 7, 1, 10, 8, 3, 9, 1, 1, 3001, 5.67, "vo_minigame_1012_result_1015", "うん、ほとんど正解よ！\nこんな難しい問題なのに、\nすごいじゃない！\nやっぱりあんた只者じゃないわ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300117, 7, 1, 10, 7, 3, 9, 1, 1, 3001, 2.85, "vo_minigame_1012_result_1016", "着実に成長してるって感じね？\nあんたならこの難問でも、\nいつか満点取れちゃうかも…！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300118, 7, 1, 0, 5, 3, 9, 1, 1, 3001, 3.88, "vo_minigame_1012_result_1017", "うわー惜しいわね！\nもうちょっとで満点よ？\nま、あたしでも悩む難問だから、\nこの点数は胸を張っていいわ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300119, 4, 1, 0, 3, 1, 6, 1, 1, 3001, 4.12, "vo_minigame_1012_result_1018", "正解率は半分くらいか～\n悪くはないんだけど、あんたなら\nこんなもんじゃないでしょ？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300120, 4, 1, 0, 9, 1, 6, 1, 1, 3001, 4.34, "vo_minigame_1012_result_1019", "んーはっきり言っちゃうと\n中途半端な点数ね…\nまあいいわ！こっからガンガン\n点数上げていくわよ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300121, 4, 1, 0, 3, 1, 6, 1, 1, 3001, 3.15, "vo_minigame_1012_result_1020", "う～ん、正直物足りない点数ね！\nあんたには期待してんだから、\nもっと頑張んなさい！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300122, 4, 1, 0, 9, 2, 6, 1, 1, 3001, 5.3, "vo_minigame_1012_result_1021", "半分くらいの正解率か\n難しい問題だから仕方ないわね…\nでもあんたはもっとできる！\nだってあたしがついてんのよ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300123, 4, 1, 0, 8, 2, 6, 1, 1, 3001, 2.55, "vo_minigame_1012_result_1022", "うん、そこそこできんじゃない！\n頑張って勉強して\nさらに上を目指しましょ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300124, 4, 7, 0, 1, 2, 6, 1, 1, 3001, 4.19, "vo_minigame_1012_result_1023", "難問なのにこの正解率は\nよくやってる方よね！\nでもこんなところで\n満足してんじゃないわよ！？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300125, 4, 1, 0, 7, 3, 6, 1, 1, 3001, 3.43, "vo_minigame_1012_result_1024", "難問なのに半分くらい正解\nできてんじゃない♪\nこの調子でもっと学力\n上げていきましょ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300126, 4, 1, 0, 1, 3, 6, 1, 1, 3001, 0.0, "vo_minigame_1012_result_1025", "よし、平均点ってとこね！\nちゃんと勉強してるみたいで\n安心したわ～♪");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300127, 4, 7, 0, 8, 3, 6, 1, 1, 3001, 3.72, "vo_minigame_1012_result_1026", "難問揃いでこの正解率は\n大したもんよ！\nま、もっといい点取りたいんなら\n勉強、付き合ったげるわ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300128, 1, 2, 1, 3, 1, 3, 1, 1, 3001, 3.5, "vo_minigame_1012_result_1027", "なるほど…\nこれは教えがいがあるわね\nビシバシ鍛えてやるから\n覚悟しなさい！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300129, 1, 2, 1, 4, 1, 3, 1, 1, 3001, 3.25, "vo_minigame_1012_result_1028", "ちょっとあんた、\n全然できてないじゃない！\n…まさかこれが本気だなんて\n言わないわよね～？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300130, 1, 2, 0, 3, 1, 3, 1, 1, 3001, 4.62, "vo_minigame_1012_result_1029", "うーん……適当に答えても\nこれくらい正解できるわよ？\nちょっと本腰入れて\n教えないとね……！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300131, 1, 1, 0, 9, 2, 3, 1, 1, 3001, 4.5, "vo_minigame_1012_result_1030", "…ま、まあこの問題は\nあんたには難しすぎたのかもね\nちょっとずつでいいから、\nレベルアップしていきましょ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300132, 1, 3, 9, 3, 2, 3, 1, 1, 3001, 0.01, "vo_minigame_1012_result_1031", "んー結構ミスっちゃってるわね…\nこのまま続けるのもいいけど、\n簡単な問題からやり直すのも\nありかもよ～？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300133, 1, 9, 9, 9, 2, 3, 1, 1, 3001, 0.01, "vo_minigame_1012_result_1032", "あらら、あんたにはちょっと\n難しすぎたかしら…？\nもう一回やり直しましょうか！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300134, 1, 3, 6, 3, 3, 3, 1, 1, 3001, 0.01, "vo_minigame_1012_result_1033", "うーん、残念な結果ね…\n超難問だから仕方ないけど\n無理せず簡単な問題から挑戦\nしてもいいかもよ？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300135, 1, 9, 0, 3, 3, 3, 1, 1, 3001, 2.97, "vo_minigame_1012_result_1034", "正解率はかなり悪いわね…\nまあ難しい問題だもんね…！\nそのチャレンジ精神は買うわ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300136, 1, 1, 0, 3, 3, 3, 1, 1, 3001, 3.1, "vo_minigame_1012_result_1035", "なんとか０点は免れたわね…\n難問揃いだけど、\nもっと頑張っていきましょ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300137, 0, 2, 1, 6, 1, 0, 1, 1, 3001, 4.31, "vo_minigame_1012_result_1036", "…あんたさ、０点なんて\n逆に取るの難しいわよ！？\nまさか狙ったわけじゃ\nないでしょーね～！？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300138, 0, 2, 1, 2, 1, 0, 1, 1, 3001, 0.1, "vo_minigame_1012_result_1037", "０点って…\nあんたふざけてんの！？\nちゃんとやらないなら\n電撃魔法くらわせるわよ！？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300139, 0, 3, 9, 9, 1, 0, 1, 1, 3001, 4.23, "vo_minigame_1012_result_1038", "もしかしたらあんたは\n勉強向いてないのかもね…\n…勉強だけがすべてじゃないわ\n違うとこで頑張りましょ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (11300140, 0, 2, 0, 3, 2, 0, 1, 1, 3001, 4.38, "vo_minigame_1012_result_1039", "怒んないから正直に言って？\n…ふざけて答えたでしょ？\nほら、正直に\n言・い・な・さ・い？");
