INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300102, 20, 9, 0, 1, 1, -1, 2, 1, 3001, 3.85, "vo_minigame_1012_result_1046", "なによあんた、走り出したペンが\n止まらないって感じ？\nったくシンプルにすごいじゃない\n花丸あげるわ！");
