INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300145, 10, 8, 0, 1, 3, 14, 2, 1, 3001, 6.58, "vo_minigame_1012_result_1077", "うん正解率は申し分なしね！\nあとはもっと早く解ければ\nもっと点数は伸びてくわよ！\nこの調子で頑張っていきましょ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300146, 5, 7, 0, 1, 1, 9, 2, 1, 3001, 4.24, "vo_minigame_1012_result_1078", "ふ～ん、まあまあの出来だわ\n悪くはないんだけど…あんたには\nもっともっと期待してるわ～");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300147, 5, 1, 0, 7, 1, 9, 2, 1, 3001, 4.74, "vo_minigame_1012_result_1079", "うん、頑張ったけど…\n正直もっと正解できるかもね～？\nこんなのあんたには通過点！\nさらに良い点目指してみない？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300148, 5, 1, 0, 1, 1, 9, 2, 1, 3001, 0.0, "vo_minigame_1012_result_1080", "まあまあな点数だけど、\n自分的に手ごたえはどう？\nダメだって思ってんなら、\nまだまだ伸びる余地ありね！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300149, 5, 1, 0, 8, 2, 9, 2, 1, 3001, 2.21, "vo_minigame_1012_result_1081", "うん、中々の出来ね！\nでもあんたはもっといい点\n取れるはずよ！\nもっと頑張りましょうか！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300150, 5, 1, 0, 3, 2, 9, 2, 1, 3001, 2.46, "vo_minigame_1012_result_1082", "ん～はっきり言って微妙ね！\nま、難しい問題だし、\n勉強すれば\n点数は上がっていくと思うわ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300151, 5, 1, 0, 3, 2, 9, 2, 1, 3001, 2.94, "vo_minigame_1012_result_1083", "ん～…\n10点には届かなかったか～\n次は10点越え目指して\n頑張ってみない？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300152, 5, 1, 0, 7, 3, 9, 2, 1, 3001, 4.19, "vo_minigame_1012_result_1084", "はいお疲れ～\n点数的にはまあまあってとこね！\nま、超難問だし頑張ったわよ");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300153, 5, 1, 0, 1, 3, 9, 2, 1, 3001, 0.0, "vo_minigame_1012_result_1085", "うん、かなり難しい問題なのに\n最後までやり遂げたわね\n次はもっといい点目指してみる？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300154, 5, 1, 0, 3, 3, 9, 2, 1, 3001, 2.63, "vo_minigame_1012_result_1086", "ちょっとミスが多かったかもね～\nでも間違えた所は復習して\n次は正解するわよー！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300155, 1, 1, 0, 3, 1, 4, 2, 1, 3001, 5.53, "vo_minigame_1012_result_1087", "あら…あんまり良くない点数ね～\nどうしたの、調子でも悪かった？\n次はもっと頑張りましょうか");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300156, 1, 3, 9, 3, 1, 4, 2, 1, 3001, 0.01, "vo_minigame_1012_result_1088", "ん～…正解数は\n物足りないわね～\nもうちょっと勉強の時間\n増やしちゃおっか？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300157, 1, 1, 3, 3, 1, 4, 2, 1, 3001, 4.15, "vo_minigame_1012_result_1089", "ん～…あんたならもうちょと\nいい点取れんでしょ～？\nもっと頑張んなさいよ\n期待してやってんだからさ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300158, 1, 9, 9, 9, 2, 4, 2, 1, 3001, 0.01, "vo_minigame_1012_result_1090", "ん～今のあんたには、\nこの問題は難しかったかしら…\n難易度下げてチャレンジするのも\nありかもね～？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300159, 1, 1, 0, 3, 2, 4, 2, 1, 3001, 5.37, "vo_minigame_1012_result_1091", "あんまり出来は良くないわね～\n難しい問題だししょうがないけど\n次はもっと頑張ってほしいわ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300160, 1, 1, 0, 3, 2, 4, 2, 1, 3001, 1.44, "vo_minigame_1012_result_1092", "なるほど…\nちょっと苦手な問題が多かった？\nもう一度チャレンジ\nしてみましょうか～");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300161, 1, 3, 0, 3, 3, 4, 2, 1, 3001, 0.0, "vo_minigame_1012_result_1093", "んん～…問題が難しすぎた？\n無理に難しい問題続けるより、\n難易度下げた方が\n勉強の効率良いかもよ～？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300162, 1, 9, 3, 3, 3, 4, 2, 1, 3001, 2.91, "vo_minigame_1012_result_1094", "…あんまり点数取れなかったわね\nこれはあたしにも難しい問題だし\nそう落ち込まなくても大丈夫！\n次頑張りましょ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300163, 1, 1, 0, 5, 3, 4, 2, 1, 3001, 2.61, "vo_minigame_1012_result_1095", "ごめん、ちょっと難しすぎた？\nもう一度チャレンジするも良し、\n難易度を下げるも良し、\nあんたがやる気なら付き合うわ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300164, 0, 2, 1, 4, 1, 0, 2, 1, 3001, 3.63, "vo_minigame_1012_result_1096", "ちょっとあんた…\nやる気ないわよね～！？\n次こんな点数取ったら\n怒るわよ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300165, 0, 2, 1, 6, 1, 0, 2, 1, 3001, 4.16, "vo_minigame_1012_result_1097", "はあ…自分で何点取ったか\n分かってるわよね～…？\n０点よ０点！　舐めてんの！？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300166, 0, 3, 6, 3, 1, 0, 2, 1, 3001, 0.01, "vo_minigame_1012_result_1098", "うう～頭痛い…\nあんたのせいよ！\nなに０点って！\nはあ、このままじゃ赤点よ～…");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300167, 0, 2, 0, 6, 2, 0, 2, 1, 3001, 5.75, "vo_minigame_1012_result_1099", "ねえ、あんた本気でやったの？\nまさか適当にやるわけないわよね\n…分かった、\nもう一回チャレンジするのよ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300168, 0, 2, 1, 4, 2, 0, 2, 1, 3001, 5.64, "vo_minigame_1012_result_1100", "あ…あんた、０点よ０点…！\nあたしの教え方が悪かった…？\n…燃えてきたわ！\n絶対あんたの学力上げてやる！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300169, 0, 4, 8, 8, 2, 0, 2, 1, 3001, 5.73, "vo_minigame_1012_result_1101", "ちょっと待って採点ミスかも…\n…いや合ってるわね。はい０点\n…って０点！？\nふざけんなーー！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300170, 0, 3, 1, 5, 3, 0, 2, 1, 3001, 5.32, "vo_minigame_1012_result_1102", "あらら…０点よ\nま、難しい問題だしね…\n…つっても０点は無いわ！\n一問くらい正解しなさいよ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300171, 0, 9, 9, 3, 3, 0, 2, 1, 3001, 2.37, "vo_minigame_1012_result_1103", "残念だけど０点よ\nま、まあ前向きにとらえるなら、\n今が底よ！　どん底！\nあとは上がってくだけね！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (12300172, 0, 1, 3, 9, 3, 0, 2, 1, 3001, 4.25, "vo_minigame_1012_result_1104", "…かなり出来が悪いわね\n一旦休憩しましょうか？\nリフレッシュして頭切り替えて\nもう一度頑張りましょう！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (13100101, 0, 7, 0, 7, 0, 0, 3, 1, 1001, 0.0, "vo_minigame_1012_gamestart_100", "さ、勉強を始めるわよ");
