INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300156, 1, 4, 6, 4, 1, 4, 2, 2, 3001, 0.01, "vo_minigame_1012_result_2088", "うーん…さっぱり！\nでも簡単な問題なんだよね…？\nもっかいやってみる？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300157, 1, 3, 0, 0, 1, 4, 2, 2, 3001, 5.28, "vo_minigame_1012_result_2089", "うちらまだまだ\nベンキョーちうだし…\nこれからだよねっ？\nね、ヒデサイ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300158, 1, 3, 0, 0, 2, 4, 2, 2, 3001, 2.89, "vo_minigame_1012_result_2090", "ちょっとずつ覚えれば\nおーけーっしょ！\nうちと一緒に\nベンキョーだね！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300159, 1, 7, 0, 0, 2, 4, 2, 2, 3001, 5.45, "vo_minigame_1012_result_2091", "うちベンキョー苦手でも\nヒデサイとベンキョー\nするのは好き！　だから\nもっかい教えてくれる？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300160, 1, 10, 3, 4, 2, 4, 2, 2, 3001, 4.29, "vo_minigame_1012_result_2092", "覚えても、すぐ忘れるんだけど\nどしたらいい？\nあ、そーゆうとき\nフクシューする感じ？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300161, 1, 8, 6, 4, 3, 4, 2, 2, 3001, 4.64, "vo_minigame_1012_result_2093", "ムズ過ぎ！\n頭パンクするかと思った…！\nヒデサイ、うちの頭\nふぅふぅして～");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300162, 1, 5, 0, 9, 3, 4, 2, 2, 3001, 3.14, "vo_minigame_1012_result_2094", "おにムズ過ぎてテンサゲ～\nでもヒデサイがんばってるし\nうちもがんばる！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300163, 1, 4, 0, 7, 3, 4, 2, 2, 3001, 6.59, "vo_minigame_1012_result_2095", "ヒデサイと同じ点数で\nちょっち安心したかも\n一緒にがんばろーね！\n置いてっちゃやだよ？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300164, 0, 3, 0, 3, 1, 0, 2, 2, 3001, 0.0, "vo_minigame_1012_result_2096", "…まあ、これより下はないし\n次は大逆転\n点数爆上がりっしょ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300165, 0, 10, 5, 9, 1, 0, 2, 2, 3001, 2.2, "vo_minigame_1012_result_2097", "０点じゃん…\nそだ、次はえんぴつ転がして\n選ぶ作戦やってみる？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300166, 0, 4, 6, 4, 1, 0, 2, 2, 3001, 0.01, "vo_minigame_1012_result_2098", "考えるの無理な時あるよね…\nヒデサイもそーゆう\n感じだったの？");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300167, 0, 2, 3, 6, 2, 0, 2, 2, 3001, 2.8, "vo_minigame_1012_result_2099", "え、ヒデサイも０点？\nじゃあうちと一緒じゃん♪\nまあ焦んないで\nベンキョーしてこーよ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300168, 0, 4, 6, 9, 2, 0, 2, 2, 3001, 3.22, "vo_minigame_1012_result_2100", "むむむ～…０点…！\n覚えてもすぐ忘れちゃうし\nベンキョーってマジ大変");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300169, 0, 0, 11, 4, 2, 0, 2, 2, 3001, 2.1, "vo_minigame_1012_result_2101", "０点だね…\nでも、へーきへーき\nリベンジしたら、結果オーライ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300170, 0, 2, 3, 0, 3, 0, 2, 2, 3001, 2.74, "vo_minigame_1012_result_2102", "おやつ休憩して\nリベンジしよっ！\n甘いの食べたら、イケるっしょ！");
INSERT INTO `v1_316030515ba1abdda4a5dbf6b8aab5d06f56c1363ce657fd0e22d035e8fd8920` VALUES (22300171, 0, 9, 9, 6, 3, 0, 2, 2, 3001, 3.0, "vo_minigame_1012_result_2103", "ヒデサイでも\nおにムズな感じ？\nじゃあ、このテスト\n誰も解けなくない？");
